import { Link } from "react-router-dom";
import "../App.css";

function Home() {
  return (
    <>
      {/* HERO SECTION */}
      <section className="hero ">
        <section className="hero2  x text-center">
          <div className="hero-content mx-auto col-lg-8 col-md-10 col-12">
            <h1 className="fw-bold">Book Your Appointment Easily</h1>
            <p className="mt-3  mb-4 fs-5">
              Schedule appointments anytime, anywhere with trusted professionals.
            </p>
            <Link to="/BookAppointment" className="btn btn-warning btn-lg">
              Book Appointment
            </Link>
          </div>
        </section>
      </section>
    </>
  );
}

export default Home;
